// src/components/Header.js
import React from 'react';
import './Header.css';  // 添加自定义样式

const Header = () => {
    return (
        <header className="header">
            <div className="navbar">
                <h1 className="logo">mikechen</h1>
                <nav>
                    <ul>
                        <li><a href="#topics">项目实战</a></li>
                        <li><a href="#projects">AI赋能</a></li>
                        <li><a href="#interviews">大厂面试题</a></li>
                        <li><a href="#about">关于</a></li>
                    </ul>
                </nav>
                <button className="login-btn">登录</button>
            </div>
            <div className="hero-section">
                <h2>面试突击</h2>
                <h3>mikechen</h3>
            </div>
        </header>
    );
}

export default Header;
